#include <stdio.h>
#include <stdlib.h>
#include <string.h>


char* removeStars(char* s) {

    int i = 0, c = 0;
    char* ans;
    ans = (char*)malloc((100001)*sizeof(char));

    while(s[i]){
        if(s[i] == '*'){
            c--;
        } else {
            ans[c] = s[i];
            c++;
        }
        i++;
    }
    
    if(c < 0)
        ans[0] = '\0';
    else
        ans[c] = '\0';

    return ans;
}

